eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   insights: () => (/* binding */ insights)\n/* harmony export */ });\n// data/insights.ts\nconst insights = [\n    {\n        slug: \"matter-vs-zigbee-vs-wifi-2025\",\n        title: \"Matter vs. Zigbee vs. Wi-Fi: Picking the Right Smart-Home Backbone in 2025\",\n        excerpt: \"A practical comparison for real homes: reliability, latency, range, power, and how to plan a future-proof stack for VeaLive-style automations.\",\n        date: \"2025-08-12\",\n        readMins: 14,\n        cover: \"/images/popular-iot-protocols.jpg\",\n        coverAlt: \"Smart home network protocols illustrated\",\n        tags: [\n            \"Protocols\",\n            \"Planning\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"If ‚Äòsmart‚Äô ever felt flaky, it‚Äôs usually the network beneath the devices. This article translates protocol jargon into real-home choices so lights feel instant, sensors stay trustworthy, and automations don‚Äôt fall apart when the Wi-Fi hiccups.\",\n                    \"We‚Äôll compare Matter, Thread, Zigbee, and Wi-Fi in plain terms‚Äîwhat each actually does, where it shines, and the trade-offs you‚Äôll live with over months and years. The goal is a backbone that fades into the background while your home quietly does the right thing.\"\n                ]\n            },\n            {\n                id: \"why-it-matters\",\n                heading: \"Why picking a protocol really matters\",\n                paras: [\n                    \"Most ‚Äòsmart-home headaches‚Äô trace back to transport and topology. If your presence sensors drop, your scenes don‚Äôt trigger. If your bulbs lag, mood lighting feels like a gimmick. Protocol choice sets your baseline for reliability and speed.\",\n                    \"At VeaLive we architect from the goals backward: what needs instant response (e.g., mmWave occupancy), what can be polled (energy), and what must work offline (security, safety). The right backbone lets the home feel alive rather than programmable.\",\n                    \"A helpful test is to time real interactions: door opens ‚Üí hall lights on; desk presence ‚Üí task lights bright. If these land in ~200‚Äì300 ms consistently, your transport is healthy. When it slips to seconds or fails intermittently, the protocol and topology need attention.\"\n                ]\n            },\n            {\n                id: \"matter-what-it-is\",\n                heading: \"Matter in two lines‚Äîand what it‚Äôs not\",\n                paras: [\n                    \"Matter is an application layer (not a radio) that standardizes how devices describe themselves and interoperate. It typically rides over Thread or Wi-Fi. The promise is consistent commissioning, multi-admin control (Apple/Google/Alexa), and less vendor lock-in.\",\n                    \"What Matter isn‚Äôt: a magic wand for flaky radios. Thread border routers still need good placement and power; Wi-Fi still needs well-planned 2.4 GHz airtime. Treat Matter as a language‚Äîthen engineer the network that speaks it fluently.\",\n                    \"In practice, Matter reduces glue-code and ‚Äòbridge sprawl‚Äô. You can keep using favorite apps and voice assistants without trapping yourself in a single vendor‚Äôs island, and migrations become a sequence of small swaps instead of a painful reset.\"\n                ],\n                note: \"For sensor networks, Thread (not Wi-Fi) often yields better battery life and mesh stability.\"\n            },\n            {\n                id: \"zigbee-vs-thread\",\n                heading: \"Zigbee vs. Thread: cousins with different futures\",\n                paras: [\n                    \"Zigbee remains battle-tested with huge device catalogs and stable meshes, especially in pro installs. Thread is younger but designed for IP‚Äîsimplifying routing and cloud-free integrations. Both are low-power mesh radios in the 2.4 GHz band.\",\n                    \"If you‚Äôre starting fresh, Thread is the safer long-term bet (given Matter). If you own lots of Zigbee, don‚Äôt rip it out‚Äîbridge it. VeaLive often runs hybrid stacks: Thread for sensors/locks, Zigbee for legacy lighting, plus a lean Wi-Fi for high-bandwidth endpoints.\",\n                    \"Think of Zigbee as the mature workhorse with every attachment under the sun, while Thread is the modern chassis built for the next decade of local-first control. The sweet spot for most homes is a calm hybrid that respects sunk cost but points forward.\"\n                ],\n                bullets: [\n                    \"Latency: Thread ~low, Zigbee ~low; both beat congested Wi-Fi for sensors\",\n                    \"Battery life: Thread ‚âà Zigbee (both excellent)\",\n                    \"Device breadth: Zigbee > Thread (for now)\",\n                    \"Interoperability: Thread + Matter > Zigbee (fewer vendor islands)\"\n                ]\n            },\n            {\n                id: \"wifi-when-to-use\",\n                heading: \"Where Wi-Fi still wins\",\n                paras: [\n                    \"Video, voice, and high-bit-rate audio remain Wi-Fi territory. Some premium switches and bridges are also Wi-Fi for convenience. The key is airtime budgeting: avoid dozen of chatty 2.4 GHz devices. Place APs carefully, reduce co-channel interference, and cap transmit power indoors.\",\n                    \"Treat 2.4 GHz like a slow shared bus: ideal for range and sleepy devices, not bulk data. Push heavy lifting to wired or 5/6 GHz, and keep IoT chatter from drowning out endpoints that truly need responsiveness.\"\n                ],\n                bullets: [\n                    \"Use 5 GHz/6 GHz for bandwidth; reserve 2.4 GHz for range/IoT\",\n                    \"Disable unnecessary 2.4 GHz SSIDs to cut beacon noise\",\n                    \"Prefer Ethernet backhaul for APs and hubs\"\n                ]\n            },\n            {\n                id: \"stack-designs\",\n                heading: \"Reference stacks VeaLive deploys\",\n                paras: [\n                    \"Apartment: Thread for sensors/locks, Zigbee for retrofit lighting, Wi-Fi for cameras/speakers; a single hub bridges to Matter for multi-admin control.\",\n                    \"Villa: Redundant Thread border routers, dedicated PoE APs, wired backhaul, and an edge server for local automations; Wi-Fi cameras and NVR on isolated VLAN.\",\n                    \"Renovation tip: if you can, pull low-voltage to doors, ceilings, and racks. One inexpensive cable now unlocks cleaner upgrades for years.\"\n                ]\n            },\n            {\n                id: \"migration\",\n                heading: \"Migrating without downtime\",\n                paras: [\n                    \"Map critical automations, then duplicate them on the new stack before decommissioning the old one. Work room-by-room, keep legacy hubs online temporarily, and timebox cutovers to daytime windows. Your home shouldn‚Äôt notice the upgrade.\",\n                    \"Keep a rollback scene per room so you can revert in one tap while you debug edge cases. Confidence grows when changes are reversible.\"\n                ]\n            },\n            {\n                id: \"verdict\",\n                heading: \"Bottom line\",\n                paras: [\n                    \"Matter + Thread is the long-term center of gravity. Keep Zigbee where it shines; segment Wi-Fi for heavy endpoints. Above all, design for presence, not just commands‚Äîyour system should notice you, not wait for you.\",\n                    \"If you only optimize one thing, make it presence reliability. Once that‚Äôs solid, every other automation feels smarter and more natural.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Do I need to replace my Zigbee gear?\",\n                a: \"No. Bridge it where practical. We often run mixed networks and phase devices out over natural upgrade cycles.\"\n            },\n            {\n                q: \"Is Wi-Fi bad for sensors?\",\n                a: \"Not inherently, but battery life and congestion suffer. Low-power mesh radios are generally superior for presence and contact sensors.\"\n            }\n        ]\n    },\n    {\n        slug: \"circadian-lighting-real-homes\",\n        title: \"Circadian Lighting That Actually Feels Natural\",\n        excerpt: \"Beyond ‚Äòwarm at night, cool by day‚Äô. A field guide to sensors, scenes, and dimming curves so light feels like daylight‚Äîwithout the fiddling.\",\n        date: \"2025-08-10\",\n        readMins: 13,\n        cover: \"/images/lighter.jpeg\",\n        coverAlt: \"Sunlike lighting in a living room\",\n        tags: [\n            \"Lighting\",\n            \"Wellness\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"Great circadian lighting disappears into the background. It nudges you awake gently, keeps afternoons crisp, and lets evenings exhale‚Äîwithout you hunting through apps.\",\n                    \"This guide shows the few hardware choices that matter, the curves that feel human, and the small safeguards that keep everything calm instead of twitchy.\"\n                ]\n            },\n            {\n                id: \"why-light\",\n                heading: \"Light is a 24-hour signal\",\n                paras: [\n                    \"Your body treats light as information: intensity and spectrum drive alertness, mood, and sleep. Good smart lighting respects that rhythm and stays out of your way.\",\n                    \"VeaLive scenes blend presence, time, and ambient sensors, so the home shifts on its own‚Äîbrighter, cooler mornings; softer, warmer evenings; and truly dark nights.\",\n                    \"‚ÄòNatural‚Äô doesn‚Äôt mean complicated. Two or three well-named scenes with smooth ramps beat a dozen brittle automations that fight the occupants.\"\n                ]\n            },\n            {\n                id: \"hardware\",\n                heading: \"Hardware that makes it easy\",\n                paras: [\n                    \"Look for high CRI (‚â•95) and ‚Äòsunlike‚Äô spectra in key rooms. Avoid flicker at low dims; 1% smooth dimming matters more than headline lumens. For switches, prefer decoupled relays so power remains to smart lamps.\",\n                    \"Control glare as much as brightness. Indirect fixtures and larger emitting surfaces feel gentle at night, while focused task lights keep counters useful without washing out the room.\"\n                ],\n                bullets: [\n                    \"Bedrooms: warm-bias (1800‚Äì3000K) with ultra-low dim\",\n                    \"Kitchens: high CRI task lights; motion + counter scenes\",\n                    \"Work nooks: indirect, glare-free with cool boost on focus\"\n                ]\n            },\n            {\n                id: \"sensors\",\n                heading: \"Sensors: presence + ambient lux + time\",\n                paras: [\n                    \"Presence is the trigger, ambient light and time are the context. Combine mmWave presence with a ceiling lux sensor, then let a scheduler set the target scene curve across the day.\",\n                    \"Calibrate once over a week: note moments that felt ‚Äòtoo blue‚Äô or ‚Äòtoo dim‚Äô, then nudge the curve a little. Small edits preserve predictability.\"\n                ],\n                note: \"Use ‚Äògrace periods‚Äô on motion/mmWave to prevent flicker when someone sits still.\"\n            },\n            {\n                id: \"curves\",\n                heading: \"Designing curves that feel human\",\n                paras: [\n                    \"Instead of hard switches at 7PM, use ramps: 20-minute transitions feel like the sky changing. Add ‚Äòrainy day‚Äô overrides when outdoor lux drops early. The goal isn‚Äôt accuracy; it‚Äôs comfort.\",\n                    \"End the evening curve slightly earlier than you expect‚Äîsleep quality improves when the house winds down before you do.\"\n                ]\n            },\n            {\n                id: \"failsafes\",\n                heading: \"Failsafes and manual affordances\",\n                paras: [\n                    \"Map one physical button to ‚Äòfull bright‚Äô and another to ‚Äònight path‚Äô. If sensors misfire, people still have agency. Store last manual state briefly to avoid fighting the user.\",\n                    \"A tiny ‚Äòhow lights work‚Äô card near the door helps guests and preserves the vibe you designed.\"\n                ]\n            },\n            {\n                id: \"case-study\",\n                heading: \"Case study: two-bed apartment\",\n                paras: [\n                    \"We replaced four scenes and three apps with one daily curve and two physical presets. The result: hands-free mornings, calm evenings, and no one asking, ‚Äúhow do I turn these off?‚Äù\",\n                    \"Energy use also dropped‚Äîno more overshooting brightness on cloudy afternoons. Comfort first; efficiency follows.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Do I need tunable white in every room?\",\n                a: \"No. Focus on living, work, and bedrooms. Static warm in corridors is fine if nighttime paths are gentle.\"\n            }\n        ]\n    },\n    {\n        slug: \"diy-3d-printed-smart-automation\",\n        title: \"DIY 3D-Printed Automation: From Brackets to Beautiful\",\n        excerpt: \"How we prototype durable parts‚Äîsensor mounts, cable guides, motor couplers‚Äîand graduate them from PLA to finished, room-ready pieces.\",\n        date: \"2025-08-07\",\n        readMins: 12,\n        cover: \"/images/Ender-3-Pro-1024x768.webp\",\n        coverAlt: \"3D printed fixtures for smart sensors\",\n        tags: [\n            \"DIY\",\n            \"Fabrication\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"3D printing turns ‚Äòalmost fits‚Äô into ‚Äòfits perfectly‚Äô. With a weekend of iteration you can make parts that look intentional in real rooms instead of like temporary hacks.\",\n                    \"Below is the short list of materials, finishes, and design tricks we use so brackets and couplers feel like part of the house, not lab leftovers.\"\n                ]\n            },\n            {\n                id: \"why-3d\",\n                heading: \"Why 3D printing belongs in smart homes\",\n                paras: [\n                    \"Real homes aren‚Äôt lab benches. Sensors need neat mounts, cables need strain relief, and motors need couplers that actually fit cabinetry. Printing lets us tailor parts to millimeters and match finishes.\",\n                    \"Speed is a feature: test a quick draft tonight, install a refined version tomorrow. That cadence keeps projects moving and prevents ‚Äòtemporary‚Äô solutions from becoming permanent eyesores.\"\n                ]\n            },\n            {\n                id: \"materials\",\n                heading: \"Materials and finishes that last\",\n                paras: [\n                    \"PLA is fine for quick drafts. For service parts, switch to PETG or ABS. Add brass heat inserts, sand to 400-600, and spray with satin clear. For touch surfaces, TPU grips feel premium and hide seams.\",\n                    \"Outdoors or sunny windows? Favor ASA or light-colored PETG for heat/UV resistance. Most ‚Äòwow‚Äô comes from finishing: a little sanding and clear coat elevates the part from prototype to product.\"\n                ],\n                bullets: [\n                    \"PETG: heat-resistant, easy to print\",\n                    \"ABS: more post-processing, great for enclosures\",\n                    \"TPU: vibration isolation and cable boots\"\n                ]\n            },\n            {\n                id: \"mounts\",\n                heading: \"Mounting sensors without ruining walls\",\n                paras: [\n                    \"Use 3M VHB with printed keyholes. Add a 1‚Äì2 mm standoff channel for cable exit, and a replaceable faceplate so you can swap sensors later without repainting.\",\n                    \"If screws are required, print a drill guide and use tiny pilots. A tidy cable exit and level faceplate make the install look built-in.\"\n                ]\n            },\n            {\n                id: \"motors\",\n                heading: \"Couplers and linkages for blinds and valves\",\n                paras: [\n                    \"We model couplers around the actual shaft geometry; tolerances of \\xb10.1 mm matter. When torque is high, pin the coupler with a steel dowel and add a printed guard for fingers.\",\n                    \"Light lubrication on contact points helps, and check play at temperature‚Äîplastics expand. A keyed profile plus a single set screw usually outlasts glue.\"\n                ]\n            },\n            {\n                id: \"kits\",\n                heading: \"From one-off to ‚Äòkit‚Äô\",\n                paras: [\n                    \"Label parts, include spare fasteners, and add QR codes linking to a micro-manual. That turns a hack into something installable by future-you (or our team) in five minutes.\",\n                    \"If a friend can build it from your kit without calling you, you‚Äôve designed it right.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Can printed parts handle heat near windows?\",\n                a: \"Use PETG/ASA and avoid dark colors in direct sun. We also design small ventilation slots for enclosures.\"\n            }\n        ]\n    },\n    {\n        slug: \"privacy-by-design-local-first\",\n        title: \"Privacy by Design: Building a Local-First Smart Home\",\n        excerpt: \"Cloud is useful‚Äîbut should be optional. Here‚Äôs how we keep critical automations and data at the edge while still enjoying modern conveniences.\",\n        date: \"2025-08-05\",\n        readMins: 11,\n        cover: \"/images/AdobeStock_145218093.jpg\",\n        coverAlt: \"Local-first home automation diagram\",\n        tags: [\n            \"Privacy\",\n            \"Security\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"Local-first doesn‚Äôt mean anti-cloud; it means your home keeps working when the internet blinks. The trick is to keep safety and daily comfort on hardware you control, and use cloud where it truly helps.\",\n                    \"These are the principles and tactics we use so you get modern convenience without handing over the keys to your house.\"\n                ]\n            },\n            {\n                id: \"principles\",\n                heading: \"Principles we won‚Äôt compromise\",\n                paras: [\n                    \"Minimum data, maximum value. Local control for safety functions. Transparent logs. Updateable systems. These aren‚Äôt slogans‚Äîthey‚Äôre design constraints.\",\n                    \"If a feature requires cloud, we ask: what happens during an outage? Can a local fallback keep essentials running? Asking that early improves the system immediately.\"\n                ]\n            },\n            {\n                id: \"edge\",\n                heading: \"Edge hubs and why they matter\",\n                paras: [\n                    \"An on-prem controller keeps scenes, credentials, and schedules available during outages. It also reduces round-trip latency and avoids spraying data across third-party clouds.\",\n                    \"Edge makes experimentation safer: test new routines locally, then decide what‚Äîif anything‚Äîneeds remote access.\"\n                ]\n            },\n            {\n                id: \"accounts\",\n                heading: \"Accounts, keys, and guests\",\n                paras: [\n                    \"Use per-person accounts with roles, not shared logins. Time-limit guest access. Back up keys offline. If you change phones, your house shouldn‚Äôt forget you.\",\n                    \"QR-based onboarding with expiry beats texting passwords. You‚Äôll be more generous with access when revoking it is effortless.\"\n                ]\n            },\n            {\n                id: \"network\",\n                heading: \"Network segmentation in plain English\",\n                paras: [\n                    \"Put cameras on an isolated VLAN, block cross-talk, and forward only what‚Äôs needed to the controller. Your TV doesn‚Äôt need to see your nursery cam.\",\n                    \"Simple rule: if a device doesn‚Äôt need to talk to other devices, put it on a ‚Äòcontroller-only‚Äô island. Fewer conversations, fewer surprises.\"\n                ],\n                bullets: [\n                    \"Strong DNS, DoT/DoH where appropriate\",\n                    \"Turn off UPnP unless explicitly required\",\n                    \"Auto-patch the edge hub on a maintenance window\"\n                ]\n            },\n            {\n                id: \"tradeoffs\",\n                heading: \"Trade-offs and how we handle them\",\n                paras: [\n                    \"Voice assistants and remote control imply some cloud. We prefer multi-admin Matter so you can use voice without giving cloud services the keys to everything.\",\n                    \"When cloud is useful, pick services with local fallbacks and granular permissions. The aim is choice, not purism.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Can I go 100% offline?\",\n                a: \"Yes for core automations, but push notifications, voice assistants, and remote access usually require selective cloud use.\"\n            }\n        ]\n    },\n    {\n        slug: \"luxury-smart-living-beyond-gadgets\",\n        title: \"Luxury Smart Living: Comfort You Don‚Äôt Have to Think About\",\n        excerpt: \"True luxury is effortlessness. We orchestrate climate, light, scent, sound, and privacy so spaces feel curated‚Äînot gimmicky.\",\n        date: \"2025-08-03\",\n        readMins: 12,\n        cover: \"/images/1.jpg\",\n        coverAlt: \"Luxury living room with subtle smart lighting\",\n        tags: [\n            \"Luxury\",\n            \"Design\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"Luxury is the absence of friction. The tech is invisible, the results are obvious, and guests simply feel taken care of without instructions.\",\n                    \"Here‚Äôs how we compose climate, light, sound, scent, and privacy so rooms feel curated day after day‚Äînot just on install day.\"\n                ]\n            },\n            {\n                id: \"philosophy\",\n                heading: \"The philosophy: remove friction\",\n                paras: [\n                    \"Luxury automation is not more buttons‚Äîit‚Äôs fewer decisions. The system senses context and chooses well most of the time, with graceful overrides when you want control.\",\n                    \"We hunt micro-annoyances: glare on a screen, a chilly draft, a fan that starts too loud. Removing them is what reads as ‚Äòpremium‚Äô in daily life.\"\n                ]\n            },\n            {\n                id: \"comfort-stack\",\n                heading: \"The comfort stack: climate, light, sound, scent, privacy\",\n                paras: [\n                    \"We treat comfort like a stack. Climate sets the baseline, light directs attention, sound defines mood, scent cues memory, and privacy shapes ease. Scenes blend them with intent.\",\n                    \"Two or three named moods per room (Arrival, Focus, Wind Down) reduce cognitive load. People can feel the difference without learning a manual.\"\n                ]\n            },\n            {\n                id: \"materials\",\n                heading: \"Materials and interfaces that age well\",\n                paras: [\n                    \"Wall controls should feel like jewelry, not gadgets. Solid metals, ceramic finishes, engraved labels. The UI is how your home shakes your hand‚Äîmake it timeless.\",\n                    \"Digital UIs deserve the same care: calm typography, subtle transitions, no shouting colors. The best interface often is no interface at all.\"\n                ]\n            },\n            {\n                id: \"service\",\n                heading: \"Service is part of the product\",\n                paras: [\n                    \"We schedule seasonal tune-ups: filter reminders, scene refreshes, and new routines for school/holidays. Luxury is reliability over time, not just day-one wow.\",\n                    \"Keep a short owner‚Äôs log of changes and reasons. It preserves coherence as life evolves‚Äînew pets, new schedules, visiting family.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Can luxury be sustainable?\",\n                a: \"Yes. Overspec where it increases longevity and comfort, not consumption. Efficient HVAC, daylight-first lighting, and good insulation are luxuries in practice.\"\n            }\n        ]\n    },\n    {\n        slug: \"pet-friendly-smart-home-utilities\",\n        title: \"Pet-Friendly Smart Homes: Fresh Air, Clean Floors, Calm Routines\",\n        excerpt: \"Sensors and automations that keep homes fresher with pets‚Äîair quality, feeding, litter, and gentle lighting for midnight wanderers.\",\n        date: \"2025-08-01\",\n        readMins: 11,\n        cover: \"/images/ÂæÆ‰ø°ÂõæÁâá_20240830184159-jpg.webp\",\n        coverAlt: \"Dog in a cozy automated home\",\n        tags: [\n            \"Pets\",\n            \"Utility\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"Pets add joy‚Äîand extra chores. A few thoughtful automations keep the house fresh, floors clean, and nights peaceful without stressing your companions.\",\n                    \"The aim is predictable, gentle routines. Start small, then let the system take over once everyone‚Äôs comfortable.\"\n                ]\n            },\n            {\n                id: \"air\",\n                heading: \"Air quality and odor control\",\n                paras: [\n                    \"Link VOC sensors to ventilation and filtration. Boost quietly after feeding or litter cycles, then return to baseline. Your nose should never notice the schedule.\",\n                    \"Pair boosts with door/window sensors so you don‚Äôt ventilate during a dust storm or pollen spike. Quiet, targeted actions beat always-on fans.\"\n                ]\n            },\n            {\n                id: \"feeding\",\n                heading: \"Feeding and hydration\",\n                paras: [\n                    \"Smart feeders aren‚Äôt just timers‚Äîpair them with weight sensors and activity to adjust portions. For water, UV-sterilized fountains with flow reminders keep things healthy.\",\n                    \"Gentle pre-feed cues (soft light, short chime) reduce bounding excitement and help multi-pet households avoid jostling at the bowl.\"\n                ]\n            },\n            {\n                id: \"cleaning\",\n                heading: \"Fur, litter, and floor care\",\n                paras: [\n                    \"Map robot-vac routes that avoid bowls and toys. Trigger a quick sweep after outdoor door events on rainy days. Small touches add up to a cleaner baseline.\",\n                    \"Schedule noisier jobs while you‚Äôre out. A calmer soundscape keeps pets relaxed and prevents anxious behavior.\"\n                ]\n            },\n            {\n                id: \"lighting\",\n                heading: \"Night paths for pets (and humans)\",\n                paras: [\n                    \"Warm, low-level path lights prevent startle. Tie to pet motion zones and avoid the main ceiling lights at night. Peaceful for them, humane for you.\",\n                    \"If a pet sleeps in your room, nudge brightness even lower and extend timeouts‚Äîno one wants a light show at 3 a.m.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Will automations scare my pet?\",\n                a: \"Use slow ramps, quiet fans, and predictable routines. Start with manual triggers and increase automation as your pet acclimates.\"\n            }\n        ]\n    },\n    {\n        slug: \"smart-dome-360-living\",\n        title: \"Living in a 360\\xb0 Smart Dome: Structure Meets Sensibility\",\n        excerpt: \"A geodesic shell that reduces thermal load, a tight envelope that stays quiet, and an automation-native core that feels alive.\",\n        date: \"2025-07-28\",\n        readMins: 13,\n        cover: \"/images/DKO-4-1.webp\",\n        coverAlt: \"Smart dome habitat in a garden\",\n        tags: [\n            \"Smart Dome\",\n            \"Architecture\"\n        ],\n        sections: [\n            {\n                id: \"intro\",\n                heading: \"Introduction\",\n                paras: [\n                    \"Domes are more than a look‚Äîthey‚Äôre physics turned into comfort. The geometry lowers stress points and helps with thermal stability, which makes automation calmer and more effective.\",\n                    \"This overview covers envelope choices, services, and where to place sensors so the structure and the system feel like one idea.\"\n                ]\n            },\n            {\n                id: \"geometry\",\n                heading: \"Why the geometry matters\",\n                paras: [\n                    \"Domes distribute load and minimize surface area for a given volume‚Äîgreat for thermal performance and weather. Add modern glazing and insulation, and the result is a calm, durable shell.\",\n                    \"Fewer flat spans mean fewer creaks in wind and fewer leaks at seams. The ‚Äòquiet‚Äô you feel indoors is the structure doing its job.\"\n                ]\n            },\n            {\n                id: \"envelope\",\n                heading: \"Envelope and glazing options\",\n                paras: [\n                    \"Pre-engineered panels with gasketed seams and low-E glass keep the interior stable. Electrochromic or solar-dimming glass reduces glare without heavy blinds.\",\n                    \"Balance visible light transmission with solar gain: a small spec change can turn a hot room into a bright, comfortable one.\"\n                ]\n            },\n            {\n                id: \"automation\",\n                heading: \"Automation-native by design\",\n                paras: [\n                    \"Sensors are planned with the structure: ceiling lux, ridge-mounted ventilation, perimeter mmWave, and a central controller. The dome knows its state and responds smoothly.\",\n                    \"Because cable runs radiate from the center, plan conduits early. You‚Äôll thank yourself when adding shades, fans, or acoustic panels later.\"\n                ]\n            },\n            {\n                id: \"use-cases\",\n                heading: \"Use cases: studio, retreat, lab\",\n                paras: [\n                    \"We‚Äôve used domes as rooftop studios, garden offices, and wellness nooks. Linked pods with decks form small villages‚Äîscalable and special.\",\n                    \"For retreats, pair scent and circadian scenes with quiet ventilation. The space feels both airy and grounded.\"\n                ]\n            },\n            {\n                id: \"install\",\n                heading: \"Install and services\",\n                paras: [\n                    \"Kits land on prepared anchors or a light slab, go up in sequence, and connect to power/data in a day. Off-grid options pair PV, battery, and efficient HVAC.\",\n                    \"Label junctions and leave service loops. A single afternoon of documentation pays back for years of painless tweaks.\"\n                ]\n            }\n        ],\n        faq: [\n            {\n                q: \"Is it hot in summer?\",\n                a: \"The geometry reduces gain, and glazing plus shading manage the rest. With proper ventilation, domes stay surprisingly comfortable.\"\n            }\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/insights.ts\n");

